import ReactDOM from "react-dom/client";

const BookList = () => {
  return (
    <section>
      <Book></Book>
    </section>
  );
};

const Book = () => {
  return (
    <article>
      <Image></Image>
      <Title></Title>
      <Author></Author>
    </article>
  );
};

const Image = () => (
  <img
    src="https://images-na.ssl-images-amazon.com/images/I/61KI7oL-u9L._AC_UL900_SR900,600_.jpg"
    alt="The Woman in Me"
  />
);
const Title = () => <h2>Book Title</h2>;
const Author = () => {
  return <h2>Author</h2>;
};

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(<BookList></BookList>);
